import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar sticky-top navbar-light bg-light">
      <a img src="http://learning.theacademy.ac/wp-content/uploads/2017/10/tAhs-BW-340156-300x138.png" alt="TOEFL  I  SAT  I  College Consulting  I  Boston  "></a>
    </nav>
  );
}

export default Nav;
